  input: '"TEXT","F3XA","C00167320","Q1. In response to your letter dated November
    23, 2005, regarding $56,631.85 in MEMO entries on Schedule A, the Committee erroneously
    failed to disclose in memo text the corresponding information associated with
    said MEMO entries.  This information is now disclosed in this amended report.
    Q2. The Committee erroneously failed to indicate in memo text on Schedule A its
    share of gross contributions received through Victory Fund and ASDC Dollars for
    Democrats.  Said text has now been added to each of these items on Schedule A
    in this amended report. Q3.  The Committee conducted a full review of Schedule
    H3 Administrative activity which resulted in transfers from our non federal account
    and found that, due to a data entry error on our June Monthly Report, May 2, 2005
    administrative and fundraising transfers were both disclosed as administrative
    transfers on Schedule H3 of that report.  The Committee fixed this clerical error
    and amended its June Monthly Report.  The Committee also found that the administrative
    transfer of allocated activity on June 27, 2005, disclosed on the July Monthly
    Report, was made within the required time period. Q4. The Committee inadvertently
    failed to disclose its debt to a credit card vendor.  Said debt has now been disclosed
    on Schedule D of this amended report."'
